import * as React from "react";
import { styled } from "@mui/material/styles";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell, { tableCellClasses } from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import Paper from "@mui/material/Paper";
import axios from "axios";
import CustomizedTables from "./CustomizedTables";

const StyledTableCell = styled(TableCell)(({ theme }) => ({
  [`&.${tableCellClasses.head}`]: {
    backgroundColor: "red",
    color: theme.palette.common.white,
  },
  [`&.${tableCellClasses.body}`]: {
    fontSize: 14,
    padding: 15,
  },
}));

const StyledTableRow = styled(TableRow)(({ theme }) => ({
  //   "&:nth-of-type(odd)": {
  //     backgroundColor: "#64CCC5",
  //   },
  //   "&:nth-of-type(even)": {
  //     backgroundColor: "white",
  //   },
  // hide last border
  //   "&:last-child td, &:last-child th": {
  //     border: 0,
  //   },
}));

const TestHome = () => {
  const [state, setState] = React.useState({
    datas: [],
  });
  React.useEffect(() => {
    getUuser();
  }, []);
  const getUuser = () => {
    axios
      .get("https://mongo6.sultantracker.com/api/bincry/sold")
      .then((res) => {
        const data = res.data;
        // console.log(data);
        const old = { ...state };
        old.datas = data;
        setState(old);
      });
  };
  return (
    <div
      style={{
        height: "100vh",
        width: "100%",
        background: "gray",
        display: "flex",
        flexDirection: "column",
      }}
    >
      <div style={{ height: "10vh", width: "100%", background: "silver" }}>
        fsadf
      </div>
      <div
        style={{
          height: "90vh",
          width: "100%",
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
          flexDirection: "column",
        }}
      >
        <div style={{ height: "88vh", width: "99%", background: "white" }}>
          <div
            style={{
              height: "10%",
              width: "100%",
              background: "silver",
              display: "flex",
              alignItems: "center",
              justifyContent: "space-around",
              flexDirection: "row",
            }}
          >
            <h4 style={{ align: "left" }}>SELLING QUANTITY</h4>
            <h4 style={{ align: "left" }}>SELLING AMOUNT</h4>
            <h4 style={{ align: "left" }}>CURRENCY</h4>
            <h4 style={{ align: "left" }}>BUYING PRICE</h4>
            <h4 style={{ align: "left" }}>BUYING QUANTITY</h4>
            <h4 style={{ align: "left" }}>BUYING AMOUNT</h4>
            <h4 style={{ align: "left" }}>INSERT DATE</h4>
          </div>
          <div
            style={{
              height: "90%",
              width: "100%",
              background: "white",
              overflowY: "scroll",
            }}
          >
            {<CustomizedTables item={state.datas} />}
          </div>
        </div>
        {/* <div style={{ height: "10%", width: "100%", background: "red" }}>
          div_top
        </div>
        <div style={{ height: "90%", width: "100%", background: "white" }}>
          div_Bottom
        </div> */}
        {/* <div
          style={{
            height: "97%",
            width: "99%",
            background: "white",
            overflowY: "scroll",
          }}
        >
          {<CustomizedTables item={state.datas} />}
        </div> */}
      </div>
    </div>
  );
};

export default TestHome;
